import React from 'react';

const Skills = () => {
  const skills = [
    { name: 'React', icon: '‚öõÔ∏è', description: 'Frontend Library' },
    { name: 'Node.js', icon: 'üü¢', description: 'Backend Runtime' },
    { name: 'MongoDB', icon: 'üçÉ', description: 'Database' },
    { name: 'Express', icon: '‚ö°', description: 'Web Framework' },
    { name: 'TypeScript', icon: 'üíô', description: 'Type Safety' },
    { name: 'Tailwind', icon: 'üé®', description: 'CSS Framework' },
    { name: 'Git', icon: 'üîß', description: 'Version Control' },
    { name: 'AWS', icon: '‚òÅÔ∏è', description: 'Cloud Services' }
  ];

  return (
    <section id="skills" className="relative z-10 w-full max-w-7xl mx-auto px-6 py-24">
      <div className="text-center mb-16">
        <h2 className="font-display text-4xl md:text-5xl font-bold mb-6">
          Technical <span className="text-outline">Skills</span>
        </h2>
        <p className="text-lg text-gray-600 dark:text-gray-400 max-w-2xl mx-auto">
          Technologies and tools I use to bring ideas to life
        </p>
      </div>
      
      <div className="grid grid-cols-2 md:grid-cols-4 gap-8">
        {skills.map((skill, index) => (
          <div 
            key={index}
            className="group text-center p-6 rounded-2xl border border-gray-200 dark:border-gray-700 hover:border-black dark:hover:border-white transition-all hover:-translate-y-2"
          >
            <div className="text-4xl mb-4">{skill.icon}</div>
            <h3 className="font-display font-bold mb-2">{skill.name}</h3>
            <p className="text-sm text-gray-600 dark:text-gray-400">{skill.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Skills;
